import {useState, useEffect} from 'react';

const OrderForm = () => {
    const [formFields, setFormFields] = useState({
        name: "",
        address: "",
        pack: "",
        number: "",
        date: ""
    })

    return ( 
            <div className="form">
                <form>
                    <label for="name">NAME</label>
                    <input type="text" id="name"  value={formFields.name}/>
                    <label for="address">ADDRESS</label>
                    <input type="text" id="address" value={formFields.address} required/>
                    <label for="number">PHONE NUMBER</label>
                    <input type="phone" id="number"  value={formFields.number} required/>
                    <label for="date">DELIVERY DATE</label>
                    <input type="text" id="date" value={formFields.date}/>
                </form>
            </div> );
}
 
export default OrderForm;
